import React, {Component, Fragment} from "react";
import styles from "./Feedback.module.css";
import {Link} from "react-router-dom";
import logo from "../../../images/new_лого.png";
import image from "../../../images/img.png";
export default class Feedback extends Component{
    render () {
        return (
            <Fragment>
                <div className={styles.wrapper}>
                    <Link to="/">
                        <span className="icon-close">
                            <ion-icon name="close" />
                        </span>
                    </Link>
                    <img className={styles.logo} src={logo} alt="logotype"/>
                    <img className={styles.image} src={image} alt="image"/>
                    <h1 className={styles.tittle}>Обратная связь</h1>
                    <input className={styles.inputName} type="text" required/>
                    <input className={styles.inputMail} type="email" required/>
                    <input className={styles.inputMessage} type="text" required/>
                    <button type={"submit"}>Отправить</button>
                </div>
            </Fragment>
        );
    }
}
